import React, { useState } from 'react';

const Greetings = () => {

    const userName = "Ezgi"
    const userSurname = "KardeÅŸ"
    const [counter, setCounter] = useState(0);
    const counterLet = 0;

    return(
        <div>
            <h1>Merhaba {userName} {userSurname}...</h1>
            <h3>Counter: {counter}</h3>
            <button 
                onClick = {() => {
                  setCounter(counter + 1);
                }}
            >
            Counter artÄ±r
             </button>
             <h3>Counter Let: {counterLet}</h3>
             <button 
                onClick = {() => {
                counterLet ++;
                console.log("counterLet: ", counterLet);
             }}
             >Counter let artÄ±r</button>
        </div>
    )
}

export default Greetings;
